import './App.css';

import Home from './components/home';
import About from './pages/About/about'
import {BrowserRouter as Router, 
  Switch, 
  Route, 
   } from 'react-router-dom';


function App() {


  return (
    <Router>
     <Switch> 

      <Route exact path="/">
        <Home /> 
      </Route>

      <Route exact path='/about'>
        <About/>
      </Route>

     </Switch>
    </Router>



  );
}

export default App;
